// Table
import { useTable } from 'react-table';

const UsersDetails = ({users}) => {
    const COLUMNS = [
        {
           Header: "Name",
           accessor: "fullname"
        },
        {
           Header: "Position",
           accessor: "position"
        },
        {
           Header: "e-Mail",
           accessor: "email"
        },
        {
           Header: "Last login",
           accessor: "lastlogin"
        },
        {
           Header: "Status",
           accessor: "status"
        }
    ];

    const table = useTable({COLUMNS, users});

    return ( 
        <div><h1>Users</h1></div>
    );
}
 
export default UsersDetails;
